import React, { useState } from 'react';
import ReactMapGL, {NavigationControl, Marker} from "react-map-gl";

export default function Map() {
  const [viewport, setViewport] = useState({
    latitude: 40.629620,
    longitude: -8.657000,
    zoom: 16,
    width: "99vw",
    height: "92vh",
    bearing: 275
  });

  return (
    <ReactMapGL
      {...viewport}
      mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}
      onViewportChange={viewport => {setViewport(viewport)}}
    >
      <div style={{position: 'absolute', right: 0}}>
          <NavigationControl />
          <Marker
            key={0}
            latitude={40.633213}
            longitude={-8.659457}
          >
            AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAADMAIOFHJFIHSAFUDSAHYFUAYHDFIUAYFUSYFUAYOUFSYUAYFSO
          </Marker>
      </div>
    </ReactMapGL>
  );
}
